import axios from "axios";
import { useEffect,useState} from "react";

function Axios1()
{
    const [data,setdata]=useState([]);
    useEffect(()=>{
        axios.get("https://jsonplaceholder.typicode.com/posts").then((res)=>{setdata(res.data)})
    })

    return(
        <>
         <table>
            <tr>
                <th>USERID</th>
                <th>ID</th>
                <th>TITLE</th>
                <th>body</th>
            </tr>
        </table>
        {data.map((filtering)=>{
        const {userId,id,title,body}=filtering;
        return(
            <>
            <tr><td>userId</td><td>{id}</td><td>{title}</td><td>{body}</td></tr>
        </>)
        })}
        </>
    )
}
export default Axios1;
